import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

const Navbar = () => {
  return (
    <nav className="nabar">
      <ul className="nav-links">
        <li><Link to="/home">Home</Link></li>
        <li><Link to="/">Products</Link></li>
        <li><Link to="/about">About</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
